import * as mongoose from "mongoose";
import {
	PokemonStats,
	PokemonMove,
	PokemonMoves,
	PokemonAbilities,
	PokemonDamages,
	PokemonMisc,
	Pokemon,
	PokemonType,
} from "../types/pokemon.type";

const Schema = mongoose.Schema;

const PokemonStatsSchema = new Schema<PokemonStats>(
	{
		hp: Number,
		attack: String,
		defense: String,
		spattack: String,
		spdefense: String,
		speed: Number,
	},
	{ _id: false }
);

const PokemonMoveSchema = new Schema<PokemonMove>(
	{
		learnedat: String,
		name: String,
	},
	{ _id: false }
);

const PokemonMovesSchema = new Schema<PokemonMoves>(
	{
		level: [PokemonMoveSchema],
	},
	{ _id: false }
);

const PokemonAbilitiesSchema = new Schema<PokemonAbilities>(
	{
		normal: [{ type: String }],
		hidden: [{ type: String }],
	},
	{ _id: false }
);

const PokemonDamagesSchema = new Schema<PokemonDamages>(
	{
		normal: String,
		fire: String,
		water: String,
		electric: String,
		grass: String,
		ice: String,
		fight: String,
		poison: String,
		ground: String,
		flying: String,
		psychic: String,
		bug: String,
		rock: String,
		ghost: String,
		dragon: String,
		dark: String,
		steel: String,
	},
	{ _id: false }
);

const PokemonMiscSchema = new Schema<PokemonMisc>(
	{
		abilities: PokemonAbilitiesSchema,
		classification: String,
		height: String,
		weight: String,
	},
	{ _id: false }
);

const PokemonSchema = new Schema<Pokemon>(
	{
		id: Number,
		name: String,
		img: String,
		nickname: String,
		moves: PokemonMovesSchema,
		damages: PokemonDamagesSchema,
		stats: PokemonStatsSchema,
		misc: PokemonMiscSchema,
		type: [
			{
				type: String,
				enum: Object.values(PokemonType),
			},
		],
	},
	{
		collection: "pokemon",
		autoIndex: true,
		minimize: true,
	}
);

export default mongoose.model("PokemonSchema", PokemonSchema);

import * as express from "express";
import PokemonModel from "../model/pokemon.model";

const pokemonExpressRoute = express.Router();

const handleError = (res: any, next: any) => (error: any, data: any) => {
	if (error) {
		console.log("handleError: ", error);
		return next(error);
	}

	res.json(data);
};

pokemonExpressRoute.route("/pokemon").get((req: any, res: any, next: any) => {
	console.log("Fetch pokemon list req.query", req.query);
	const searchParams = req.query.q
		? { name: { $regex: req.query.q, $options: "i" } }
		: {};
	console.log("Fetch pokemon list searchParams", searchParams);

	PokemonModel.find(searchParams)
		.sort({ id: "asc" })
		.exec(handleError(res, next));
});

pokemonExpressRoute
	.route("/pokemon/:id")
	.get((req: any, res: any, next: any) => {
		console.log("Fetch pokemon req.params:", req.params);
		PokemonModel.findOne({ id: req.params.id }, handleError(res, next));
	});

export default pokemonExpressRoute;

export enum PokemonType {
	NORMAL = "Normal",
	FIRE = "Fire",
	WATER = "Water",
	ELECTRIC = "Electric",
	GRASS = "Grass",
	ICE = "Ice",
	FIGHTING = "Fighting",
	POISON = "Poison",
	GROUND = "Ground",
	FLYING = "Flying",
	PSYCHIC = "Psychic",
	BUG = "Bug",
	ROCK = "Rock",
	GHOST = "Ghost",
	DRAGON = "Dragon",
	DARK = "Dark",
	STEEL = "Steel",
	FAIRY = "Fairy",
}

